import React from 'react'
import { AppBar, Toolbar, Typography, makeStyles, Button, Box } from '@material-ui/core'; 




const useStyle = makeStyles((theme) => ({
	component: {
	    flexGrow: 1,

	    background: 'rgba(61, 153, 252, 1)',
	    '& > *': {
	      padding: theme.spacing(1),
	    }
	  },

	  title: {
	    flexGrow: 1,
	    padding: 20,
	    color: 'black',
	    fontWeight: 'bold',
	    fontSize: '33px'

	  },
	  img: {
	    marginLeft: 60,
	    '& > *': {
	      padding: theme.spacing(1),
	    }
	  },
	  btn: {
	    marginTop: '5px',
	    marginRight: 60,
	    width: '422px',
	    display: 'flex',
	    flexDirection: 'row',
	    color: 'black',


	    '& > *': {
	      padding: theme.spacing(1),
	    },

	  },
	  btn1:{
	    borderRad: '10px',
	    height: '33px',
	    width: '91px',
	    fontSize: '15px',
	    marginTop: '3px',
	    marginLeft: '6px'
	  }

      }));


function About() {
	return (
		<div>
			About
		</div>
	)
}

export default About;
